import{_ as e,o as t,c as o,O as n}from"./chunks/framework.9482e208.js";const f=JSON.parse('{"title":"§ 10.1-705 Definitions.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/10.1-705.md","filePath":"vacode/10.1-705.md"}'),a={name:"vacode/10.1-705.md"},i=n('<h1 id="§-10-1-705-definitions" tabindex="-1">§ 10.1-705 Definitions. <a class="header-anchor" href="#§-10-1-705-definitions" aria-label="Permalink to &quot;§ 10.1-705 Definitions.&quot;">​</a></h1><p>As used in this article, unless the context requires a different meaning:</p><p>&quot;Agency of this Commonwealth&quot; includes the government of this Commonwealth and any subdivision, agency, or instrumentality, corporate or otherwise, of the government of this Commonwealth.</p><p>&quot;Board&quot; means the Board of Conservation and Recreation.</p><p>&quot;Develop&quot; or &quot;development&quot; means the replenishment and restoration of existing public beaches.</p><p>&quot;Erosion&quot; means the process of destruction by the action of wind, water, or ice of the land bordering the tidal waters of the Commonwealth.</p><p>&quot;Government&quot; or &quot;governmental&quot; includes the government of this Commonwealth, the government of the United States, and any subdivision, agency, or instrumentality, corporate or otherwise, of either of them.</p><p>&quot;Locality&quot; means a county, city or town.</p><p>&quot;Program&quot; means the provisions of the Public Beach Conservation and Development Act.</p><p>&quot;Public beach&quot; means a sandy beach located on a tidal shoreline suitable for bathing in a county, city or town and open to indefinite public use.</p><p>&quot;Reach&quot; means a shoreline segment wherein there is mutual interaction of the forces of erosion, sediment transport and accretion.</p><p>&quot;United States&quot; or &quot;agencies of the United States&quot; includes the United States of America, the United States Department of Agriculture, and any other agency or instrumentality, corporate or otherwise, of the United States of America.</p><p>1980, c. 428, § 10-217; 1984, c. 750; 1985, c. 448; 1988, c. 891; 2003, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?031+ful+CHAP0079" target="_blank" rel="noreferrer">79</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?031+ful+CHAP0089" target="_blank" rel="noreferrer">89</a>.</p>',13),r=[i];function s(c,h,u,d,l,p){return t(),o("div",null,r)}const _=e(a,[["render",s]]);export{f as __pageData,_ as default};
